.CodeBlockScrollAreaRoot {
  border-radius: var(--border-radius);
  overflow: hidden;
  --scrollbar-size: 10px;
  --thumb-size: 44px;
  height: 100%;
  flex: auto;
}

.code-block-tabs + .CodeBlockRoot,
.code-block-tabs + .CodeBlockRoot .CodeBlock {
  border-top-left-radius: 0;
  border-top-right-radius: 0;
}

.CodeBlockScrollAreaViewport {
  width: 100%;
  height: 100%;
  max-height: var(--max-height);
  border-radius: inherit;
}

.CodeBlockScrollAreaScrollbar {
  display: flex;
  /* ensures no selection */
  user-select: none;
  /* disable browser handling of all panning and zooming gestures on touch devices */
  touch-action: none;
  padding: 2px;
  background: transparent;
  transition: background 160ms ease-out;
}
.CodeBlockScrollAreaScrollbar:hover {
  background: transparent;
}
.CodeBlockScrollAreaScrollbar[data-orientation='vertical'] {
  width: var(--scrollbar-size);
}
.CodeBlockScrollAreaScrollbar[data-orientation='horizontal'] {
  flex-direction: column;
  height: var(--scrollbar-size);
}

.CodeBlockScrollAreaThumb {
  flex: 1;
  background: var(--gray-6);
  border-radius: var(--scrollbar-size);
  position: relative;
}

/* increase target size for touch devices https://www.w3.org/WAI/WCAG21/Understanding/target-size.html */
.CodeBlockScrollAreaThumb::before {
  content: '';
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 100%;
  height: 100%;
  min-width: var(--thumb-size);
  min-height: var(--thumb-size);
}

.CodeBlockScrollAreaCorner {
  background: transparent;
}

.CodeBlockRoot {
  display: flex;
}

.copy-button {
  border-radius: var(--button-border-radius);
  isolation: isolate;
}

.CodeBlockRoot--one-liner .copy-button {
  border-top-left-radius: 0;
  border-bottom-left-radius: 0;
}

.CodeBlockRoot--one-liner .CodeBlockScrollAreaRoot,
.CodeBlockRoot--one-liner .CodeBlock {
  border-top-right-radius: 0;
  border-bottom-right-radius: 0;
}

.code-block-tabs + .CodeBlockRoot--one-liner .copy-button {
  border-top-right-radius: 0;
}

.code-block-tabs + .CodeBlockRoot .CodeBlockScrollAreaRoot,
.code-block-tabs + .CodeBlockRoot .CodeBlock {
  border-top-left-radius: 0;
  border-top-right-radius: 0;
}

.CodeBlockRoot--one-liner {
  --padding-vertical: 0.5rem;
  --padding-horizontal: 0.5rem;
  --code-font-size: 0.75rem;
  --scrollbar-size: 5px;
  /* Precisely makes font size and padding add to 30px tall */
  --line-height: 1.167;
}

.CodeBlockRoot--one-liner .copy-button svg {
  height: 0.875rem;
  width: 0.875rem;
}

.CodeBlockRoot--one-liner .CodeBlockScrollAreaRoot {
  --thumb-size: 15px;
}

